        "name": "Tina Anschütz",
        "descriptionDe": "Tina Anschütz ist seit 2018 Teil des Teams IT Digitalisierung der OLYMP Bezner KG in Bietigheim-Bissingen und zeigt sich für sämtliche Themenfelder aus den Bereichen Innovationen und Digitale Transformation verantwortlich. Mit ihrer Expertise treibt sie wegweisende Projekte wie den OLYMP Digital Showroom oder die digitale Produktentwicklung der Fashion Brand voran. Vom klassischen Marketing ausgehend, startete Tina Anschütz ihre Karriere bei MediaCom in Düsseldorf sowie als Senior Marketing Manager bei der Hubert Burda Media, bevor Sie sich bei der United Digital Group und später als Digital Manager bei Unilever auf die Umsetzung von Digitalisierungsprojekten spezialisierte.",
        "descriptionEn": "Tina Anschütz has been part of the IT Digitization team at OLYMP Bezner KG in Bietigheim-Bissingen since 2018 where she is responsible for all areas of innovation and digital transformation. With her expertise, she is pushing forward trailblazing projects like the OLYMP Digital Showroom or the digital product development of the fashion brand. Coming from a classical marketing background, Tina Anschütz started her career at MediaCom in Düsseldorf and as Senior Marketing Manager at Hubert Burda Media, before specializing in the execution of digitalization projects at United Digital Group and later as a Digital Manager at Unilever.",
