        "name": "Christian Klugert",
        "descriptionDe": "Christian Klugert ist seit 2019 UX Lead bei Experience One. Gemeinsam mit Kunden wie Mercedes-Benz, Daimler, OLYMP oder Baufritz konzeptioniert er User-zentrierte Plattform-Experiences vom Konfigurator über den Digital Showroom bis hin zu komplexen Informationssystemen.\n\nNach vorherigen Stationen als Online-Redakteur und Konzepter hat sich der gelernte Diplom-Informationswirt 2007 der Entwicklung Insight-basierter User Experiences verschrieben und berät Unternehmen und Agenturen bereits seit 15 Jahren als Usability Consultant. Darüber hinaus ist Klugert Co-Founder und Mitentwickler der 2012 entstandenen Plattform Gigmit, einem der größten Marktplätze im Live-Music-Booking-Segment.\n",
        "descriptionEn": "Christian Klugert has been UX Lead at Experience One since 2019. Together with clients such as Mercedes-Benz, Daimler, OLYMP and Baufritz, he designs user-centric platform experiences ranging from configurators and digital showrooms to complex information systems.\n\nAfter previous positions as an online editor and concept developer, the qualified information scientist dedicated himself to the development of insight-based user experiences in 2007 and has been advising companies and agencies as a usability consultant for 15 years. Klugert is also co-founder and co-developer of the Gigmit platform, one of the largest marketplaces in the live music booking segment, which was created in 2012.",
