        "name": "Sabine Jünger",
        "descriptionDe": "Sabine Jünger, 1969 in Wolfsburg geboren, ist seit August 2021 Direktorin Advertising Services bei OTTO. Nach ihrem Abschluss in BWL startete Jünger ihre Karriere 1995 bei dem Pay-TV-Anbieter Premiere. Nach Stationen bei AOL, als COO ihres eigenen Video-Ad-Start-ups, beim SPIEGEL und Amazon Advertising, wechselte Sabine Jünger 2020 als Head of RAFT (Retail, Automobile, Finance & Telco) Northern Europe zu Pinterest. Seit August 2021 leitet Sabine Jünger die Advertising Services bei OTTO und verantwortet in dieser Position OTTOs Retail-Media-Business, sowie weitere Marketingservices für Partner. Jünger hat sich als Ziel gesetzt, Kund*innen mittels Retail Media entlang der gesamten Customer Journey zu erreichen. Das Potenzial? Riesig. ",
        "descriptionEn": "Sabine Jünger, born in Wolfsburg in 1969, has been Director Advertising Services at OTTO since August 2021. After graduating in business administration, Jünger started her career at the pay-TV provider Premiere in 1995. After holding positions at AOL, as COO of her own video ad start-up, at SPIEGEL and Amazon Advertising, Sabine Jünger moved to Pinterest in 2020 as Head of RAFT (Retail, Automobile, Finance & Telco) Northern Europe. Since 2021, Sabine Jünger has been Head of Advertising Services at OTTO and is responsible for OTTO's retail media business, as well as other marketing services for partners. Jünger has set herself the goal of using retail media to reach customers along the entire customer journey. The potential? Huge.  ",
