        "name": "Felix Schwarz",
        "descriptionDe": "Felix Schwarz ist Digital Consultant und seit 2019 Treiber der digitalen Transformation von Hays.\n\nAls Digital Consultant berät er Unternehmen sowie Unternehmer:innen die Chancen von Sichtbarkeit via Social Media auszuschöpfen – damit die jeweiligen Anspruchsgruppen noch überzeugender begeistert werden können\n\nSeit 2021 ist er Co-Lead für das offizielle Corporate Influencer Programm von Hays. Das Programm umfasst 30 Corporate Influencer:innen aus Deutschland & Österreich. Das erklärtes Ziel ist, Hays durch die Vielfalt der Mitarbeitenden sichtbar & attraktiv für Bewerber:innen, Kund:innen sowie Kandidat:innen zu machen. \n\nSeit 2019 unterstützt er Hays bei der Entwicklung innovativer Lösungen als Mitglied des Social Selling Matrix Teams.",
        "descriptionEn": "Felix Schwarz is a Digital Consultant and has been driving Hays' digital transformation since 2019.\n\nAs Digital Consultant, he advises companies and entrepreneurs to maximize the many opportunities of social media - to inspire stakeholders even more convincingly\n\nSince 2021, he has been co-lead for Hays' official Corporate Influencer Program. The program comprises 30 corporate influencers from Germany & Austria. The declared priority is to make Hays visible and attractive for applicants, customers and candidates through the diversity of the employees.\n\nFurthermore, he has been driving the development of innovative solutions as a member of the Social Selling Matrix team - an organizational incubator.\n\n",
