        "descriptionDe": "Johannes van de Loo befasst sich seit seinem Studium der Druck- & Medientechnologie mit individualisierter Kundenkommunikation. Zwischenzeitlich mehrere Jahre als Innovations-Manager einer Druckereigruppe tätig, leitet er heute das Beratungsunternehmen SmartCom. \n\nAls Individualisierungs-Experte ist er darauf spezialisiert, automatisierte und selbstlernende Prozesslösungen für die Ausgabe von hoch individualisierten (KI-basierten) Print- & E-Mail-Kampagnen erfolgreich in die OmniChannel-Marketingstrategie seiner Kunden zu integrieren. Dabei behält er stets den Mehrwert für seine Kunden im Blick und bietet Ihnen maßgeschneiderte Lösungen zur Vertriebsoptimierung im Dialogmarketing.",
