        "name": "Dr. Michael  Gschwender",
        "descriptionDe": "Als freiberuflicher Hacker und Cyber Security Specialist ist Dr. Michel Gschwender Experte für Phishing-Abwehr, Ransomware-Readiness und IT-Sicherheitskonzepte. Seine Klienten kommen aus sämtlichen Wirtschafts- und Gesellschaftsbereichen, darunter auch Start-Ups, Nichtregierungsorganisationen (NGOs) und Einrichtungen der öffentlichen Verwaltung, die er bei Pen-Tests, IT-Security Audits und Weiterbildungen zur IT-Sicherheit betreut. Seit 2022 ist er als Lehrbeauftragter im Bereich Kommunikationspsychologie an der IST-Hochschule für Management tätig.\nNeben seiner Dozenten- und Beratertätigkeit schreibt Dr. Michael Gschwender regelmäßig Artikel über aktuelle Entwicklungen der Hackerszene.",
