        "name": " Claus-Dominique  Otto",
        "descriptionDe": "Claus-Dominique Otto Jahrgang 1974, studierte Germanistik und Politikwissenschaften. Seine berufliche Karriere startete er 2003 bei der größten deutschen Mediaagentur Mediacom in Düsseldorf. Hier betreute er unter anderem die Marken P&G, Deutsche Telekom, Lindt und dm - sowohl in der klassischen als auch in der digitalen Mediaplanung. 2011 wechselte er auf Unternehmensseite zu congstar, wo er zunächst für die Mediaplanung und die Marktforschung sowie die Budgetführung im Marketing verantwortlich war. Ab 2019 führte er fachlich das Team Media & Brand. Seit 2021 leitet er gemeinsam mit Maike Schmidt das Team Brand & Content - ganzheitlich mit Schwerpunkt in der strategischen Planung für die Marken- und Produktkommunikation.",
