        "name": "Tanja Hofmann",
        "descriptionDe": "Tanja Hofmann ist seit 16 Jahren Teil des Lush Teams und hat nach ihrem Start als (nebenberfliche) Sales Assistent im Düsseldorfer Lush Shop ihre vielseitige Karriere damit begonnen, die Einführung des Charity Pot Konzept 2010 auf dem deutschen Markt zu betreuen. In den folgenden Jahren setzt sie unter anderem als Brand Managerin nationale und europaweiten Kampagnen um. 2014 folgt ein Wechsel ins European-Team, wo sie als Internal Communications Coordinator anfing und später als European Brand & Digital Principal die zehn europäischen Märkte in den Bereichen interne Kommunikation, eCommerce und Branding unterstützt. Seit 2021 ist Tanja Hofmann als Strategy Lead zurück im Deutschen Team",
