        "descriptionDe": "Veronika ist VP und Tech Innovationsmanagerin bei msg systems AG. Sie bringt eine holistische und strategische Perspektive basierend auf einer interdisziplinären und internationalen Karriere mit. Als Entrepreneurin und Beraterin zuvor im Telekom-Konzern tätig, entwickelte sie eine preisgekrönte IoT- und Connected Car-Lösung für die Automobilindustrie und für DHL den bekannten Logistik Trend Radar. In Spanien war Veronika Head of New Business und Marktforschung bei Correos, wo sie ein neues Produktcluster Data Products aufbaute und eine Tiefenstudie Dialogmarketing 360° B2C und B2B veröffentlichte.Zuvor war sie in Madrid CLO/COO eines amerikanischen Verlags mit Online Handel als auch Technologie- und Strategie-Consultant bei Arthur D.Little.",
