        "slug": "ddv",
        "descriptionDe": "Der Deutsche Dialogmarketing Verband ist einer der größten nationalen Zusammenschlüsse von Dialogmarketing-Unternehmen in Europa und gehört zu den Spitzenverbänden der Kommunikationswirtschaft in Deutschland. Als die treibende Kraft der Data Driven Economy repräsentiert der DDV Unternehmen, die Daten generieren oder für den professionellen datenbasierten und kundenzentrierten Dialog nutzen. Gemeinsam mit unseren Mitgliedern wollen wir substanzielle Mehrwerte durch individuelle Beziehungen zwischen Menschen, Marken und Unternehmen in einer vernetzten Welt schaffen. Schwerpunkte des Verbandsengagements sind politische Arbeit, Informationsaustausch, Qualitätssicherung und Nachwuchsförderung. ",
        "descriptionEn": "The German Dialog Marketing Association is one of the largest national associations of dialog marketing companies in Europe and one of the leading associations of the communication industry in Germany. As the stimulating force of the data-driven economy, the DDV represents companies that generate data or use it for professional data-driven and customer-centric dialog. Together with our members we want to create substantial added value through individual relationships between people, brands and companies in a networked world. The focal points of the association's commitment are public relations, information exchange, quality assurance and the promotion of young talents."
