        "descriptionEn": "As one of the leading information service providers on the German market, CRIF supports companies & financial institutions holistically in managing their Digital Customer Journey. Thanks to our 3 focus areas, you benefit from integrated Identity, Credit Risk & Fraud Management as well as innovative solutions in the areas of Digital Onboarding, Open Banking, Compliance, ESG, Address Research & Marketing Services. Individually tailored to your business model and complemented by long-standing and international analytical expertise and process consulting. CRIF Germany is part of the globally active CRIF Group with headquarters in Bologna, Italy. The group is active today with over 6,200 experts and 80+ companies in 40 countries on 4 continents."
