        "slug": "jahns-and-friends",
        "descriptionDe": "Wir sind eine Dialogmarketingagentur bei der #dialogliebe von Herzen kommt und unter die Haut geht. Durchgeknallt bei den Ideen. Detailverliebt und penibel bei der Umsetzung. Offen für jede Dialogform. Seit 1985 schaffen wir strategische, kreative & crossmediale Kommunikationslösungen in einer Disziplin, die heute alle Herzen höherschlagen lässt: data-driven Dialogmarketing. Wir arbeiten für tolle Brands aus verschiedensten Branchen, folgen dabei aber einem klaren Credo: Human. Intelligence. Communication. Weil sich alles um den Menschen dreht. Weil wir Daten intelligent analysieren, aggregieren und zum Sprechen bringen. Und weil wir auf dieser Basis eine crossmediale Kommunikation entwickeln, die Menschen bewegt und Umsätze klettern lässt.",
        "descriptionEn": "We are a dialogue marketing agency where #dialoguelove comes from the heart and gets under your skin. We are insanely creative, but meticulous in our implementations and love for detail and open to any form of dialogue. Since 1985 we have been creating strategic, creative & cross-media communication solutions in a discipline that makes everyone's heart beat faster today: data-driven dialogue marketing. We work for great brands from a wide variety of industries, but we follow a clear credo: Human. Intelligence. Communication. Because it’s all about the people. Because we analyze and aggregate data intelligently and make it soar. And because we develop data driven crossmedia communication that moves people and increases sales."
